function Header(){
    return(
        <header className="App-header">
            <h1>Hey There</h1>
            <li>
                <ul>Home</ul>
                <ul>About</ul>
                <ul>Contact</ul>
                <ul>Login</ul>
            </li>
        </header>
    );
}

export default Header;
